description:
Verenigde Staten
Actie / Drama
118 minuten

geregisseerd door Guy Moshe
met Josh Hartnett, Woody Harrelson en Ron Perlman

Een geheimzinnige zwerver (Josh Hartnett) en een vurige jonge Japanse strijder Yoshi (Gackt Camui) arriveren allebei in een stad die gedomineerd wordt door een misdaadsyndicaat. Ieder voor zich is geobsedeerd door zijn afzonderlijke missie. Wijzer geworden door het advies van een plaatselijke kroegbaas (Woody Harrelson), besluiten ze samen te werken bij de bestrijding van de misdaad in de stad. Makkelijk krijgen ze het daarbij niet: ze moeten het onder meer opnemen tegen de ontzagwekkend kwade &quot;woodcutter&quot; Nicola (Ron Perlman) en zijn levensgezellin Alexandra (Demi Moore), een femme fatale met een geheim verleden.

